import React from 'react';
import { useImagen } from '../context/ImagenContext';

function GaleriaImagenes() {
  const { imagenes } = useImagen();
  return (
    <div>
    {imagenes.map((imagen) => (
      <div className="galeria grid-columns-5 p-3" key={imagen.id}>
        <img src={imagen.src.original} alt={imagen.alt}  className="foto" />
        <Heart />
      </div>
    ))}
    </div>
  );
}

export default GaleriaImagenes;
